window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b> best seller Brennan’s latest novel featuring FBI Agent Lucy Kincaid finds her searching for a missing child in </b><b><i>Cut and Run</i></b><b>.</b></p> <p><b>\"Brennan [is] a master.\" (</b><b><i>Associated Press</i></b><b>)</b></p> <p>FBI Agent Lucy Kincaid is dead-set on solving a cold case - even if the original investigators stonewall her every step of the way. A violent storm has uncovered the remains of a family that authorities assumed fled the country years ago to avoid prosecution. But the body of the youngest Albright son never turned up. If the child is dead, why wasn’t his body found with his parents? If he’s alive, where has he been...and what does he know? Now, Lucy and her partner, Nate, must reconstruct an old crime to find a missing child in the present day.</p> <p><b>\"Can’t-put-it-down suspense.\" (</b><b><i>Fresh Fiction</i></b><b>)</b></p> <p>Meanwhile, investigative reporter Maxine Revere is called to San Antonio. A confessed killer of a young woman named Victoria has recanted his statement, which opens the door to a whole new world of secrets and betrayal. Max hires Sean Rogan, Lucy’s husband and a seasoned PI, to help. The discovery that Victoria might be connected to the Albright family leads Max, Sean, and Lucy to the darkest corridors of corporate crime. But how can they untangle this complex web to find justice for the victims...and the killer in their midst?</p> <p><b>A Macmillan Audio production from Minotaur Books</b></p> <p><b>\"If you haven’t been reading this truly exceptional Lucy Kincaid series, then you have been missing out...mind-blowing.\" (</b><b><i>RT Book Reviews</i></b><b>)</b></p>"; 
